import './App.css';

function App() {
  return (
    <div className="App">
      <Link to="/">Home</Link>
      test
      <Link to="/about">About</Link>
      <Link to="/users">Users</Link>
    </div>

  );
}
function Home() {
  return <h2>Home</h2>;
}

